import React from 'react';
import { Box, Button } from '@material-ui/core';

function TelaDois() {
    return (
        <div class="background">
            <Box 
                sx={{
                    width: 550,
                    height: 750,
                    backgroundColor: 'white',
                    borderRadius: 5,
                    padding: 5,
                }}
                centered
            >
            </Box>
        </div>
    );
}
export default TelaDois;
